class FindPathParameters:    def __init__(self, graph, path):        self.graph = graph        self.path = path    def edge_parameters_of_path(self, parameter_name):        values = []        for i in range(len(self.path) - 1):            u = self.path[i]            v = self.path[i + 1]            values.append(self.graph.edges[u, v][parameter_name])        return values    def compute(self, parameter_name, parameter_swapping_rule):        edge_vals = self.edge_parameters_of_path(parameter_name)        return parameter_swapping_rule(edge_vals)### How to use it?'''import qunex as qxfinder = qx.FindPathParameter(G, path)path_concurrence = finder.compute(parameter_name="concurrence",rule=qx.swapped_concurrence_werner)path_probability = finder.compute(parameter_name="probability",rule=qx.swapped_probability)'''